{"attr":"script","list":[{"evt":"mouseup","param":"var answer = true;
if (4 != getTag( 'seq_process%n')) {
	if (0 != getTag( 'seq_process%n')) { answer = confirm( 'Do you want to skip the current process?');}
} else if (4 != getTag( 'req_process%n')) {
	answer = confirm( 'Do you want to cancel the current request?');
}
